import React from 'react';
import { Typography } from '@material-ui/core';

const Skill = (props) => {
    return (
    <div style={{backgroundColor:'black', border:'2px solid #cdffdb', borderRadius:'50%', height:'100px', width:'100px'}}>
        <Typography
        display="block"
        justifyContent="center"
        align="center"
        variant="body1"
        style={{opacity:'100%', fontWeight:'bold', marginTop:'40%', color:'white'}}>
            {props.skillName}
        </Typography>
    </div>

    )
}

export default Skill;
